import Carousel from 'react-bootstrap/Carousel';
import 'bootstrap/dist/css/bootstrap.min.css';
import campus from './campus.png';
const Bootstrap = () => {
  return (
    <Carousel fade>
    <Carousel.Item>
          <img src={campus}
        className="one"
        alt="First slide"
    />
  </Carousel.Item>
  <Carousel.Item>
          <img src={campus}
          className="one"
      alt="Second slide"
    />
  </Carousel.Item>
  <Carousel.Item>
  <img src={campus}
      className="one"
      alt="Third slide"
    />
  </Carousel.Item>
</Carousel>
  )
}
export default Bootstrap
